    { id: 7, title: "Book 7", author: "Author Three", coverImageUrl: coverImageUrl , littleIntroduction: "This is a book about...", Introduction: "This is a book about...", price: 100}
    // 更多书籍...
];
export default function CartBookList() {
    return(
        <div className="booklist flex flex-col gap-4">
            {cartbook.map(book => (
                <CartBook
                    key={book.id}
                    coverImageUrl={book.coverImageUrl}
                    title={book.title}
                    author={book.author}
                    price={book.price}
                />
            ))}
        </div>
    )
}
